def reject_outliers(data, m=2.):
    d = np.abs(data - np.median(data))
    mdev = np.median(d)
    s = d / mdev if mdev else 1.
    return data[s<m]
    #return data[abs(data - numpy.mean(data)) < m * numpy.std(data)]

def get_uart_data():
    """
    This function serves to collect data from the serial object and storing the filtered data into a global variable.
    The function has been put into a thread since the serial event is a blocking function.
    """
    global serial_object
    global filter_data
    while(True):
        try:
            if serial_object is not None and serial_object.is_open:
                #First, clear the input buffer because we don't care about data since last read
                serial_object.flushInput()

                serial_data = serial_object.readline().decode('utf-8').strip('\r\n')
                try:
                    filter_data = floor(float(serial_data))
                    write_debug(3,'serial data: '+str(filter_data))
                except:
                    pass
                #time.sleep(0.1)
            else:
                return
        except TypeError:
            pass

def monitor_uart_connected():
    """
    This function checks the connection to the UART device and updates the status indicators in the application.
    """
    global serial_object
    global uart_connected

    while True:
        if serial_object is not None and serial_object.is_open:
                if uart_connected is not True:
                    uart_connected = True
                    value_controllerstatus.set("Connected")
                    label_controllerstatus.config(fg='green')
                    write_debug(4,'UART connected')
        else:
                if uart_connected is not False:
                    uart_connected = False
                    value_controllerstatus.set("Disconnected")
                    label_controllerstatus.config(fg='red')
        time.sleep(0.5)

def init_controller():
    """
    This function initializes the controller with default settings
    """
    write_output('Initializing controller')
    send_uart_data(b'd') #Set output to degrees
    send_uart_data(b'Ffff') #Clear filter level, set to filter level 3

def connect_uart():
    """
    This function initiates the connection to the UART device with the port and baud fed through the entry boxes in the application.
    """
    global serial_object
    port = value_port.get()
    baud = value_baud.get()

    if serial_object is not None and serial_object.is_open :
        write_output("Already connected to controller on port "+port)
        init_controller()
        return
    else:
        write_output("Attempting to connect to controller on "+port)
        try:
            try:
                serial_object = serial.Serial(str(port), baud)
                if serial_object.is_open:
                    write_output("Connected to controller")
                    init_controller()
            except:
                write_output("Cannot open specified port")
        except ValueError:
            write_output("Invalid port configured")
            return

    t1 = threading.Thread(target = get_uart_data)
    t1.daemon = True
    t1.start()

def update_gui():
    """
    This function is an update function which is also threaded. It ingests the data and updates the text box every couple seconds.
    """
    global filter_data
    global filter_data_old
    global update_period

    while(True):
        if filter_data and abs(int(filter_data_old) - int(filter_data)) > 1:
            try:
                if output_stream is not None:
                    write_debug(2,'New value: '+str(filter_data))
                    write_output('New Heading: '+str(filter_data))
                    value_data.set(filter_data)
                    #save time.time() in network tables also
            except:
                pass
            filter_data_old = filter_data

def send_uart_data(send_data):
    global serial_object
    """
    This function is for sending data from the computer to the controller
    """
    if not send_data:
        write_debug(3,'Nothing to send')
        return
    if serial_object is not None and serial_object.is_open:
        write_debug(2,'Sending to controller: '+str(send_data))
        serial_object.write(send_data)
    else:
        write_debug(3,'Controller not connected')

def disconnect_uart():
    """
    This function is for disconnecting and quitting the application. Sometimes this throws an error.
    """
    try:
        serial_object.close()
        if not serial_object.is_open:
            write_output('Disconnected from controller')
    except AttributeError:
        write_debug(3,'Closed without using it')
    #gui.quit()

def write_debug(level,data):
    global debuglevel
    if level <= debuglevel:
        print('[DEBUG:'+str(level)+'] '+data)

def write_output(data):
    global output_rows
    output_stream.insert(tk.END, data+'\n')
    output_rows += 1
    write_debug(4,'output rows '+str(output_rows))
    if output_rows >= 10:
        output_stream.delete(1.0,2.0)
        output_rows -= 1

